import React, { Component } from 'react'
import LineChart from '../LineChart/LineChart';
import DonutChart from '../DonutChart/DonutChart';
import './summary.css';

export default class Summary extends Component {
  render() {
    return (
      <div id='summary'>
            <div id='charts'>
              <div id="line-chart"><LineChart/></div>
              <div id='donut-chart'><DonutChart /></div>
            </div>

            {/* Total energy cost: line chart 
            Energy cost distribution: Dynamic 3d donut;
            <br/>
            heating/cooling status
            recent temperature */}
            <h2 className='headline'>Temperature Status</h2>
            <div id='rooms'>
              <div className='room'>Kitchen</div>
              <div className='room'>Living Room</div>
              <div className='room'>Bedroom</div>
              <div className='room'>Bathroom</div>
            </div>

      </div>
    )
  }
}
